{"answer": "Let \(v\) be the speed of one kangaroo and \(L\) the length of the highway.

1. 3 kangaroos traveling at the same speed take 18 h to cross the highway.  
   Since they travel together, the time for one kangaroo is also 18 h.  
   \[
   L = v \times 18 \quad \text{so} \quad L = \boxed{18v}
   \]

2. Each turtle travels at half the speed of a kangaroo:  
   \[
   v_{\text{turtle}} = \frac{v}{2}
   \]

3. Time for one turtle to cross the highway:  
   \[
   t_{\text{turtle}} = \frac{L}{v_{\text{turtle}}}
   = \frac{18v}{v/2}
   = \frac{18v \times 2}{v}
   = \boxed{36}
   \]

Thus a turtle takes 36 hours to cross the highway.

#### 36"}
